CREATE TABLE Categoria
(
	IdCategoria			int, 
	NombreCategoria			varchar (30), 
	Descripcion			text (255)
);


CREATE TABLE Cliente
(
	IdCliente			varchar (10), 
	NombreEmpresa			varchar (80), 
	NombreContacto			varchar (60), 
	CargoContacto			varchar (60), 
	Direccion			varchar (120), 
	Ciudad			varchar (30), 
	Region			varchar (30), 
	CodPostal			varchar (20), 
	Pais			varchar (30), 
	Telefono			varchar (48), 
	Fax			varchar (48)
);


CREATE TABLE EmpresasTransporte
(
	IdEmpresasTransporte			int, 
	NombreEmpresa			varchar (80), 
	Telefono			varchar (48)
);


CREATE TABLE Detalles_de_Pedido
(
	IdPedido			int, 
	IdProducto			int, 
	PrecioUnidad			float, 
	Cantidad			int, 
	Descuento			float
);


CREATE TABLE Empleado
(
	IdEmpleado			int, 
	Apellidos			varchar (40), 
	Nombre			varchar (20), 
	Cargo			varchar (60), 
	Tratamiento			varchar (50), 
	FechaNacimiento			date, 
	FechaContratación			date, 
	Direccion			varchar (120), 
	Ciudad			varchar (30), 
	Region			varchar (30), 
	CodPostal			varchar (20), 
	Pais			varchar (30), 
	TelDomicilio			varchar (48), 
	Extension			varchar (8), 
	Foto			varchar (510), 
	Notas			text (255), 
	Jefe			int
);


CREATE TABLE Pedido
(
	IdPedido			int, 
	IdCliente			varchar (10), 
	IdEmpleado			int, 
	FechaPedido			date, 
	FechaEntrega			date, 
	FechaEnvio			date, 
	IdEmpresasTransporte			int, 
	Cargo			float, 
	Destinatario			varchar (80), 
	DireccionDestinatario			varchar (120), 
	CiudadDestinatario			varchar (30), 
	RegionDestinatario			varchar (30), 
	CodPostalDestinatario			varchar (20), 
	PaisDestinatario			varchar (30)
);


CREATE TABLE Producto
(
	IdProducto			int, 
	NombreProducto			varchar (80), 
	IdProveedor			int, 
	IdCategoria			int, 
	CantidadPorUnidad			varchar (40), 
	PrecioUnidad			float, 
	UnidadesEnExistencia			int, 
	UnidadesEnPedido			int, 
	NivelNuevoPedido			int, 
	Suspendido			char
);


CREATE TABLE Proveedor
(
	IdProveedor			int, 
	NombreEmpresa			varchar (80), 
	NombreContacto			varchar (60), 
	CargoContacto			varchar (60), 
	Direccion			varchar (120), 
	Ciudad			varchar (30), 
	Region			varchar (30), 
	CodPostal			varchar (20), 
	Pais			varchar (30), 
	Telefono			varchar (48), 
	Fax			varchar (48), 
	PaginaPrincipal			text (255)
);

