INSERT INTO Empleado (IdEmpleado, Apellidos, Nombre, Cargo, Tratamiento, FechaNacimiento, FechaContratación, Direccion, Ciudad, Region, CodPostal, Pais, TelDomicilio, Extension, Foto, Notas, Jefe) VALUES (3,"Leverling","Janet","Representante de ventas","Srta.","1963-08-30 00:00:00","1992-04-01 00:00:00","722 Moss Bay Blvd.","Kirkland","WA","98033","EE.UU.","(206) 555-3412","3355","EMPID3.BMP","Janet es licenciada en Química por la Universidad de Boston. También ha completado un programa de formación en Gestión de minoristas de alimentación. Janet fue contratada como vendedora asociada y fue ascendida a representante de ventas.",2);
